import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import { supabase } from '../../config/supabase';

export function DrillDetails() {
  const { id } = useParams();
  const [drill, setDrill] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchDrill = async () => {
      try {
        setLoading(true);
        const { data, error } = await supabase
          .from('drills')
          .select('*')
          .eq('id', id)
          .single();

        if (error) throw error;
        setDrill(data);
      } catch (error) {
        console.error('Error fetching drill:', error);
        setError(error.message);
      } finally {
        setLoading(false);
      }
    };

    fetchDrill();
  }, [id]);

  if (loading) {
    return (
      <div className="container mx-auto px-4 py-8">
        <div className="text-center py-8">Loading drill details...</div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="container mx-auto px-4 py-8">
        <div className="text-center text-red-400">Error loading drill: {error}</div>
      </div>
    );
  }

  if (!drill) {
    return (
      <div className="container mx-auto px-4 py-8">
        <div className="text-center text-gray-400">No drill found</div>
      </div>
    );
  }

  return (
    <div className="container mx-auto px-4 py-8">
      <div className="bg-gray-800 rounded-lg p-6">
        <h1 className="text-2xl font-bold mb-4">{drill.name}</h1>
        <p className="text-gray-400 mb-6">{drill.description}</p>

        {drill.video_url && (
          <div className="mb-6">
            <h2 className="text-xl font-semibold mb-2">Video Demonstration</h2>
            <div className="aspect-w-16 aspect-h-9">
              <iframe
                src={drill.video_url}
                title="Drill Demonstration"
                className="w-full h-full rounded-lg"
                allowFullScreen
              />
            </div>
          </div>
        )}

        <div className="space-y-6">
          <div>
            <h2 className="text-xl font-semibold mb-2">Equipment</h2>
            <p className="text-gray-400">{drill.equipment_requirements || 'No equipment required'}</p>
          </div>

          <div>
            <h2 className="text-xl font-semibold mb-2">Instructions</h2>
            <p className="text-gray-400">{drill.instructions || 'No instructions available'}</p>
          </div>

          <div>
            <h2 className="text-xl font-semibold mb-2">Workout Parameters</h2>
            <div className="space-y-2">
              <p className="text-gray-400">Sets: {drill.sets || 'Not specified'}</p>
              <p className="text-gray-400">Reps: {drill.reps || 'Not specified'}</p>
              <p className="text-gray-400">Tempo: {drill.tempo || 'Not specified'}</p>
              <p className="text-gray-400">Breath: {drill.breath || 'Not specified'}</p>
              <p className="text-gray-400">Rest: {drill.rest || 'Not specified'}</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
